  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rocky
  Mountain Arsenal National Wildlife Refuge summarizes Refuge activities during the
  1989 fiscal year. The report begins with a summary of the refuge's historical management,
  U.S. Fish and Wildlife Service involvement, contamination history, and refuge purpose.
  It contains annual summaries for the following programs and studies: bald eagle
  investigation, raptor population trends, owl nesting trends, prairie dog management,
  waterfowl population trends, white-tailed and mule deer management, pronghorn reintroduction
  study, distribution and abundance of mammalian predators and passerine birds, upland
  game birds, status of reptiles and amphibians, lagomorph species studies, non-predatory
  small mammals, water resources and sport fishery management. Items of interest are
  provided at the end of the report, as well as detailed appendixes on cooperative
  research units studies, Denver Museum of Natural History projects, Colorado Division
  of Wildlife deer study, mitigation task plans, and the status of vegetation management
  activity in the Bald Eagle Management Area.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
